import React from 'react'
import Graph from 'react-vis-network-graph'
import {edges, nodes} from './databas'

export default function WorldCup() {

    const options = {
        layout: {
          hierarchical: true
        },
        edges: {
          color: "#000000"
        },
        height: "500px"
      };

    var data = {nodes: nodes, edges: edges}
  return (
    <div className='container'>
        <Graph
            graph = {data}
            options={options}
        />
    </div>
  )
}
